script: |
  super -f text -I q5773.spq | sort > q5773.out

inputs:
  - name: q5773.spq
    data: |
      SELECT 96 AS col2 FROM tab1 (FORMAT parquet) AS cor0 WHERE col2 IS NOT NULL OR col2 NOT BETWEEN + - ( + 53 ) * - 2 * - col0 AND - 4;
  - name: tab1

outputs:
  - name: q5773.out
    data: |
      96
      96
      96
